.mdl-textfield {
  position: relative;
  font-size: 16px;
  display: inline-block;
  box-sizing: border-box;
  width: 300px;
  max-width: 100%;
  margin: 0;
  padding: 20px 0; }

.mdl-textfield .mdl-button {
  position: absolute;
  bottom: 20px; }

.mdl-textfield--align-right {
  text-align: right; }

.mdl-textfield--full-width {
  width: 100%; }

.mdl-textfield--expandable {
  min-width: 32px;
  width: auto;
  min-height: 32px; }

.mdl-textfield__input {
  border: none;
  border-bottom: 1px solid rgba(0, 0, 0, 0.12);
  display: block;
  font-size: 16px;
  margin: 0;
  padding: 4px 0;
  width: 100%;
  background: none;
  text-align: left;
  color: inherit; }

.mdl-textfield.is-focused .mdl-textfield__input {
  outline: none; }

.mdl-textfield.is-invalid .mdl-textfield__input {
  border-color: #de3226;
  box-shadow: none; }

.mdl-textfield.is-disabled .mdl-textfield__input {
